- Excerpt from a two-channel recording on handheld Sony PCM-M10, mixed down to mono; no other modifications;

- Heard several soft but distinct "whit" calls from two empid flycatchers; both individuals clearly seen near top of oak tree along fenceline, just before trail disappears under water (roughly one mile from Paynes Prairie State Park Visitor Center);

First two (of three) "whit" calls from one WIFL, third (fainter) "whit" call *probably* from the second WIFL;

- Both birds interacted, vocalized, perched for about two-three minutes briefly in same tree;

- Typical empid flycatcher plumage; I was unable to determine age or sex;

- Both birds in view for between two-three minutes, sporadically calling (heard only "whit" call), then disappeared.
